import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import InicioTurmas from './components/InicioTurmas';
import Form from './components/Form';
import CriarAlunos from './components/CriarAlunos';
import CriarSalas from './components/CriarSalas';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<InicioTurmas />} />
        <Route path="/criar-alunos" element={<CriarAlunos />} />
        <Route path="/criar-salas" element={<CriarSalas />} />
        <Route path="/form" element={<Form />} />
      </Routes>
    </Router>
  );
}

export default App;
